// Add a new field called 'myNewField' to the JSON of the item

let phone = $('Set').item.json.tel

let count = phone.replace('+', '').length

if (count === 11) {
    phone = "+55" + phone.slice(1);
}

$input.item.json.tel55 = phone;

return $input.item;

